/* Function  structure for function  `checkIfParkingExists` */

/*!50003 DROP FUNCTION IF EXISTS `checkIfParkingExists` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `checkIfParkingExists`(`lat` DOUBLE, `long` DOUBLE) RETURNS int(11)
BEGIN
  DECLARE returnVariable INT ;
  #Routine body goes here...
  declare parking POINT ;
  SET parking = POINT (`lat`, `long`) ;
  SET returnVariable = 0 ;
  SELECT 
    id into returnVariable 
  FROM
    smartParking.places 
  WHERE `earth_circle_distance`(parking, loc) < 0.010 -- I CAN USE IN MYSQL 55 AND ABOVE ST_Distance_Sphere -- now check 10 meters
     #less  than  10 meters
  ORDER BY `earth_circle_distance`(parking, loc) ASC 
  LIMIT 0, 1 ;
  RETURN returnVariable ;
END */$$
DELIMITER ;

/* Function  structure for function  `earth_circle_distance` */

/*!50003 DROP FUNCTION IF EXISTS `earth_circle_distance` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `earth_circle_distance`(point1 point, point2 point) RETURNS double
    DETERMINISTIC
begin
  declare lon1,lon2 double;
  declare lat1,lat2 double;
  declare td double;
  declare d_lat double;
  declare d_lon double;
  declare a,c,R double;

  set lon1 = X(GeomFromText(AsText(point1)));
  set lon2 = X(GeomFromText(AsText(point2)));
  set lat1 = Y(GeomFromText(AsText(point1)));
  set lat2 = Y(GeomFromText(AsText(point2)));

  set d_lat = radians(lat2 - lat1);
  set d_lon = radians(lon2 - lon1);

  set lat1 = radians(lat1);
  set lat2 = radians(lat2);

  set R = 6372.8; -- in kilometers

  set a = sin(d_lat / 2.0) * sin(d_lat / 2.0) + sin(d_lon / 2.0) * sin(d_lon / 2.0) * cos(lat1) * cos(lat2);
  set c = 2 * asin(sqrt(a));

  return R * c;
end */$$
DELIMITER ;

/* Function  structure for function  `getCostforPlace` */

/*!50003 DROP FUNCTION IF EXISTS `getCostforPlace` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getCostforPlace`( `places_id` BIGINT ) RETURNS double
BEGIN#Routine body goes here...
DECLARE
	cost DOUBLE;
IF
	EXISTS (
	SELECT
		places.cost,
		places_costs.cost,
		places_costs.time 
	FROM
		places
		INNER JOIN places_costs ON places_costs.places_id = places.id  
	WHERE
		places_costs.time = 60 LIMIT 1
	) THEN
SELECT
	 places_costs.cost INTO cost
FROM
	places
	INNER JOIN places_costs ON places_costs.places_id = places.id 
WHERE
	places_costs.time = 60 LIMIT 1;
ELSE SELECT
	places.cost INTO cost
FROM
	places
	INNER JOIN places_costs ON places_costs.places_id = places.id LIMIT  1;
END IF;
RETURN cost;
END */$$
DELIMITER ;

/* Function  structure for function  `getCostforPlaceCalc` */

/*!50003 DROP FUNCTION IF EXISTS `getCostforPlaceCalc` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getCostforPlaceCalc`( `places_id` BIGINT ) RETURNS double
BEGIN#Routine body goes here...
DECLARE
	cost DOUBLE;
DECLARE
	intermtime DOUBLE;
	DECLARE
	intermcost DOUBLE;
IF
	EXISTS (
SELECT
	places.cost,
	places_costs.cost,
	places_costs.time 
FROM
	places
	INNER JOIN places_costs ON places_costs.places_id = places.id 
WHERE
	places_costs.time = 60 and places_costs.places_id=places_id
	LIMIT 1 
	) THEN
SELECT
	places_costs.cost INTO cost 
FROM
	places
	INNER JOIN places_costs ON places_costs.places_id = places.id 
WHERE
	places_costs.time = 60 and places_costs.places_id=places_id
	LIMIT 1;
ELSE
IF
	EXISTS (
SELECT
	places.cost 
FROM
	places
WHERE
	places.cost >= 0 and places.id =places_id and places.cost is not null
	LIMIT 1

) THEN
SELECT
		places.cost INTO cost 
	FROM
		places
	WHERE
		places.cost >= 0 and places.id =places_id and places.cost is not null
		LIMIT 1;
else

if exists(SELECT
		places_costs.cost  
	FROM
		places
		INNER JOIN places_costs ON places_costs.places_id = places.id 
	WHERE
		places_costs.cost >= 60 
	ORDER BY
		places_costs.time ASC 
		LIMIT 1)
  then
	SELECT
		places_costs.cost INTO intermcost 
	FROM
		places
		INNER JOIN places_costs ON places_costs.places_id = places.id 
	WHERE
		places_costs.cost >= 60 and places_costs.places_id=places_id
	ORDER BY
		places_costs.time ASC 
		LIMIT 1;

	SELECT
		places_costs.time into intermtime
	FROM
		places
		INNER JOIN places_costs ON places_costs.places_id = places.id 
	WHERE
		places_costs.cost >= 60 and places_costs.places_id=places_id
	ORDER BY
		places_costs.time ASC 
		LIMIT 1;		
	  
		set cost = (3600 * intermcost)/intermtime;
		
		else
		set cost=-1;
		end if;
		
	END IF;

END IF;
RETURN cost;
END */$$
DELIMITER ;

/* Function  structure for function  `getRankofPlace` */

/*!50003 DROP FUNCTION IF EXISTS `getRankofPlace` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getRankofPlace`( request_id BIGINT, rank BIGINT ) RETURNS bigint(20)
BEGIN
DECLARE
	mincalc BIGINT;
SELECT
	MIN( request_results.id ) INTO mincalc 
FROM
	user_requests
	INNER JOIN user_results ON user_results.user_requests_id = user_requests.id
	INNER JOIN request_results ON user_results.request_results_id = request_results.id 
GROUP BY
	user_requests.id 
HAVING
	user_requests.id = request_id;
RETURN rank - mincalc + 1;

END */$$
DELIMITER ;

/* Function  structure for function  `isBookmarkedThePlaceForUser` */

/*!50003 DROP FUNCTION IF EXISTS `isBookmarkedThePlaceForUser` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `isBookmarkedThePlaceForUser`(`User_id` bigint,`Place_id` bigint) RETURNS bigint(20)
BEGIN
	#Routine body goes here...
	declare returnResult bigint DEFAULT 0;
	SELECT
IFNULL(bookmarks.id,0) into returnResult
FROM
bookmarks
INNER JOIN places ON bookmarks.places_id = places.id
where bookmarks.places_id=Place_id and bookmarks.user_id=User_id
LIMIT 1;
	RETURN returnResult;
END */$$
DELIMITER ;

/* Procedure structure for procedure `getBookMarksofUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `getBookMarksofUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `getBookMarksofUser`(IN `user_id` bigint)
BEGIN
SELECT
bookmarks.id,
bookmarks.`temporary`,
bookmarks.description,
bookmarks.`name`,
places.`name` AS places_name,
places.lat,
places.`long`,
places.id AS places_id,
bookmarks.time,
getCostforPlaceCalc(places.id) as cost,
places.capacity,
places.comments,
places.disabledcount,
places.avaliable,
places.parkingtype_id,
places.validity
FROM
bookmarks
INNER JOIN places ON bookmarks.places_id = places.id AND bookmarks.user_id = bookmarks.user_id AND places.avaliable = 1;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `reportPlaces` */

/*!50003 DROP PROCEDURE IF EXISTS  `reportPlaces` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `reportPlaces`()
BEGIN
SELECT
	a.`name`,
	a.lat,
	a.`long`,
	a.count
FROM
	(
SELECT
	places.`name`,
