/* Procedure structure for procedure `reportRankStatistics` */

/*!50003 DROP PROCEDURE IF EXISTS  `reportRankStatistics` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `reportRankStatistics`( )
BEGIN
DECLARE
	countplaces numeric(10,4);
SELECT
	count( request_results.places_id ) INTO countplaces 
FROM
	request_results;
SELECT
ranking.places_id,
	MIN( ranking.rank ) AS minrank,
	MAX( ranking.rank ) AS maxrank,
	( MAX( ranking.rank ) + MIN( ranking.rank ) ) / 2 AS averageRank,
	countplaces as allplacesCount,
		places.`name`
FROM
	(
SELECT
	request_results.places_id,
	request_results.id AS reguest_result_id,
	`getRankofPlace` ( user_requests.id, request_results.id ) AS rank 
FROM
	user_requests
	INNER JOIN user_results ON user_results.user_requests_id = user_requests.id
	INNER JOIN request_results ON user_results.request_results_id = request_results.id 
GROUP BY
	user_requests.id,
	request_results.id 
	) AS ranking 
	inner join places on places.id=ranking.places_id	
GROUP BY
	ranking.places_id;

END */$$
DELIMITER ;

/* Procedure structure for procedure `reportRequestsDestination` */

/*!50003 DROP PROCEDURE IF EXISTS  `reportRequestsDestination` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `reportRequestsDestination`( )
BEGIN
declare maxi  numeric(8,2);

SELECT
max(requestsDestination_for_max.countRequests) into maxi
FROM
(
SELECT
user_requests.destlat,
	user_requests.destlong,
	user_requests.destloc,
	count( id ) as countRequests
FROM
	user_requests 
GROUP BY
	user_requests.destloc
) as requestsDestination_for_max;

SELECT
requestsDestination.destlat,
	requestsDestination.destlong,
	requestsDestination.destloc,
	requestsDestination.countRequests as count,
	requestsDestination.countRequests/maxi as perc
FROM
(
SELECT
user_requests.destlat,
	user_requests.destlong,
	user_requests.destloc,
	count( id ) as countRequests
FROM
	user_requests 
GROUP BY
	user_requests.destloc
) as requestsDestination
group by requestsDestination.destloc
;
END */$$
DELIMITER ;

